import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section
            className='my-[30px] xl:mt-[100px]'
        >
            <div className='container mx-auto'>
                <div className=' bg-red-200 rounded-[50px] flex flex-col text-center xl:flex-row xl:items-center'>
                    {/* Each About */}
                    <div className='flex flex-row items-center xl:flex-row xl:justify-between'>
                        {secondSection.map((item,idx)=>{
                            return (
                                <div key={idx} className="flex flex-row">
                                    <img src={item.icon} alt="" />
                                    <div>
                                        <div>{item.title}</div>
                                        <div>{item.subtitle}</div>
                                    </div>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </div>
        </section>
    )
}

export default About
